import React, { Component } from "react";
import List from "./ListGropup_mid";
const Card = ({ card_details }) => {
  const {
    mission_name,
    flight_number,
    mission_id,
    links,
    launch_year,
    launch_success,
  } = card_details || {};
  let launch_s = card_details.launch_success ? "true" : "false";
  console.log(launch_s);
  return (
    <div class="card m-1">
      <img
        class="card-img-top img-thumbnail"
        src={links.mission_patch_small}
        alt="Card image cap"
      ></img>
      <div class="card-body">
        <h5 class="card-title text-primary">{`${mission_name}#${flight_number}`}</h5>
        <List mission_ids={mission_id} />
        <p className="font-weight-bold">
          Launch Year<span> : </span>
          <span className="font-weight-light text-primary">{launch_year}</span>
        </p>
        <p className="font-weight-bold">
          Successfull launch<span> : </span>
          <span className="font-weight-light text-primary">{launch_s}</span>
        </p>
        <a href="#" class="btn btn-primary">
          Go somewhere
        </a>
      </div>
    </div>
  );
};

export default Card;
